package types

import (
	"math"
	"testing"
)

const ep = 1e-6

func TestNewColor3FromHSV(t *testing.T) {
	var e int
	for i, test := range hsvTests {
		c := NewColor3FromHSV(test.H, test.S, test.V)
		dr := test.R - float64(c.R)
		dg := test.G - float64(c.G)
		db := test.B - float64(c.B)
		if math.Abs(dr) > ep || math.Abs(dg) > ep || math.Abs(db) > ep {
			t.Errorf("HSVTest[%4d](%.4f,%.4f,%.4f): (% .9f,% .9f,% .9f) - (% .9f,% .9f,% .9f) = (% .9f,% .9f,% .9f) %.9f",
				i, test.H, test.S, test.V,
				test.R, test.G, test.B,
				c.R, c.G, c.B,
				dr, dg, db,
				ep,
			)
			e++
			if e >= 10 {
				t.Fatalf("too many errors")
			}
		}
	}
}

func TestNewColor3ToHSV(t *testing.T) {
	var e int
	for i, test := range rgbTests {
		h, s, v := Color3{R: float32(test.R), G: float32(test.G), B: float32(test.B)}.ToHSV()
		dh := test.H - h
		ds := test.S - s
		dv := test.V - v
		if math.Abs(dh) > ep || math.Abs(ds) > ep || math.Abs(dv) > ep {
			t.Errorf("RGBTest[%4d](% .9f,% .9f,% .9f): (% .9f,% .9f,% .9f) - (% .9f,% .9f,% .9f) = (% .9f,% .9f,% .9f) %.9f",
				i, test.R, test.G, test.B,
				test.H, test.S, test.V,
				h, s, v,
				dh, ds, dv,
				ep,
			)
			e++
			if e >= 10 {
				t.Fatalf("too many errors")
			}
		}
	}
}

